import React, { Component } from 'react'

export class Stock extends Component {
    render() {
        return (
            <div>
                <h1> STOCK </h1>
                <tr>
                    <th> Ticker </th>
                    <th> Volume </th>
                    <th> Time </th>
                </tr>
                {this.props.stock.map((accion) => {
                    <tr>
                    <td> {accion.ticker} </td>
                    <td> {accion.ticker} </td>
                    <td> {accion.ticker} </td>
                    </tr>
                })
                 };


            </div>
        )
    }
}

export default Stock
